import Main from "./Main";

export function calculateScore(setAnswer) {
    const spec = [4, 5, 7, 8];
    let score = 0;
  setAnswer.map(()=>{
    if (spec.includes(setAnswer)) {
      switch (Main.value) {
        case '전혀':
          score = 3;
          break;
        case '가끔':
          score = 2;
          break;
        case '자주':
          score = 1;
          break;
        case '항상':
          score = 0;
          break;
        default:
          score = 0;
      }
    } else {
      switch (Main.value) {
        case '전혀':
          score = 0;
          break;
        case '가끔':
          score = 1;
          break;
        case '자주':
          score = 2;
          break;
        case '항상':
          score = 3;
          break;
        default:
          score = 0;
      }
    }
  })
    return score;
  }
